CREATE DATABASE IF NOT EXISTS `loginsigsoft`;

USE `loginsigsoft`;

SET foreign_key_checks = 0;

DROP TABLE IF EXISTS `product`;

CREATE TABLE `product` (
  `id` int(200) NOT NULL AUTO_INCREMENT,
  `estante` varchar(200) COLLATE utf8mb4_spanish2_ci NOT NULL,
  `lado` varchar(200) CHARACTER SET utf32 COLLATE utf32_spanish2_ci NOT NULL,
  `entrepano` varchar(200) COLLATE utf8mb4_spanish2_ci NOT NULL,
  `posicion` varchar(200) COLLATE utf8mb4_spanish2_ci NOT NULL,
  `dependencia` varchar(200) COLLATE utf8mb4_spanish2_ci NOT NULL,
  `serie` varchar(300) COLLATE utf8mb4_spanish2_ci NOT NULL,
  `subserie` varchar(200) COLLATE utf8mb4_spanish2_ci NOT NULL,
  `num_Caja` varchar(200) COLLATE utf8mb4_spanish2_ci NOT NULL,
  `empresa` varchar(200) COLLATE utf8mb4_spanish2_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=23520 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_spanish2_ci;



DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(200) NOT NULL AUTO_INCREMENT,
  `email` varchar(200) CHARACTER SET utf16 COLLATE utf16_spanish2_ci NOT NULL,
  `password` varchar(200) CHARACTER SET utf16 COLLATE utf16_spanish2_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_spanish2_ci;



SET foreign_key_checks = 1;
